tions_right__placeholder:"Výchozí omezení jsou aplikována na nově připojené členy skupiny. Toto je způsob, jak mít spam a nepředvídatelné chování pod kontolou nově příchozích. Výchozí omezení mohou být nastavena s <b>časovačem</b> , který vyprší v nastaveném čase po připojení. Po skončení časovače se omezení automaticky zruší.\\n\\n Všimněte si, že správci skupiny mohou uplatnit přísnější omezení na kteréhokoli člena skupiny.",groupchat_index_description:"Indexování je způsob, jak publikovat obsah skupiny v indexovacích službách. To umožní ostatním uživatelům najít historii konverzací pomocí procházení indexu.\\n\r\nVýběr <b>Žádný</b> znamená, že skupinu není možné prohledávat a noví uživatelé ji nemohou najít prostřednictvím vyhledávání. \\n\r\n<b>Místní</b> znamená, že ji prostřednictvím vyhledávání mohou najít pouze uživatelé skupinového serveru, ale ne jiné. Toto je nejlepší možnost, pokud spouštíte interní skupiny ve velkých organizacích.\\n\r\n<b>Global</b> znamená, že skupina je indexována veřejně dostupnou službou indexování Xabber.",groupchat_membership_description:"Vyberte typ členství pro tuto skupinu. Skupiny s <b>otevřeným</b> členstvím mohou být připojeny libovolným uživatelem, pokud nejsou blokovány.\\n\r\nChcete-li bojovat proti spamu, zvažte nastavení některých výchozích omezení, která jsou aplikována na nově připojené uživatele.",groupchat_set_avatar:"Nastavit nový avatar",group_settings__properties__tooltip_click_to_set_status:"Klikněte pro nastavení stavu",groupchat_selected:"Vybráno: ",groupchat_set_member_visibility_visible:"Viditelný",groupchat_role_admin:"Správce",groupchat_role_owner:"Vlastník",groupchat_dialog_block__text:"Blokovat konkrétní XMPP adresu nebo doménu. Blokovaní uživatelé se nebudou moci v budoucnu připojit k této skupině.",groupchat_dialog_block__input_placeholder:"jmeno@priklad.cz nebo priklad.cz",groupchats_user_messages:"Uživatelské zprávy",groupchats_in_months:"za %d měsíců",groupchats_in_days:"za %d dní",groupchats_in_ho