eader:"Протоколы расширения XMPP",web_client__screen_about__block_3__header:"Разработчики",client_developer_company_name:"Redsolution",web_client__screen_about__block_3__text_1:"%1$s изначально был разработан %2$s — международной компанией по разработке программного обеспечения и услуг, в настоящее время базирующейся в Эстонии. С тех пор ряд людей присоединился к %3$s в качестве разработчиков, тестировщиков и переводчиков.",web_client__screen_about__block_3__text_3:"Следите за нами в Twitter и Github.",web_client__screen_about__block_4__header:"Переводчики",web_client__screen_about__block_5__header:"Лицензия",web_client__screen_about__block_5__text_1__link__text:"GitHub",client_developer_company_full_name:"Redsolution, OÜ",web_client__screen_about__block_5__text_4:"Смотрите %1$s %2$s для получения дополнительной информации.",web_client__screen_about__block_5__text_4__link__text:"файл лицензии",about_xabber:"Xabber является мессенджером на XMPP протоколе с <u><b>открытым</b> <i>исходным кодом</i></u> для Android, iOS и веб платформ. Он построен вокруг открытых стандартов, интерактивности, дизайна и отличного опыта использования. Версии Xabber для каждой платформы создаются для непрерывного обмена сообщениями между ними.\\nВы найдете больше информации на нашем официальном сайте https://xabber.com",about_xmpp_protocol:"Расширенный протокол сообщений и присутствия (XMPP) - это коммуникационный протокол для обмена сообщениями на основе XML (расширяемого языка разметки). Это позволяет обмениваться структурированными, но расширяемыми данными между двумя или более сетевыми структурами в реальном времени. Этот протокол первоначально был назван Jabber, и был разработан открытым сообществом Jabber в 1999 году для мгновенного обмена сообщениями в реальном времени (IM), информации о присутствии в сети и обслуживания списка контактов.",about_extension_protocols:"XMPP хорошо расширяется посредством протоколов, известных как XEPs (протоколы расширения XMPP). Xabber поддерживает несколько популярных XEPs, которые необходимы для создания чата для наших пользователей.",xabber_developers:"Xabber для Android изначально разрабатывался Redsolution — международной компанией по разработке программного обеспечения и услуг, в настоящее время базирующейся в Эстонии. С тех пор некоторые люди присоединились к Xabber в качестве разработчиков, тестировщиков и переводчиков.\\nНаша цель - создать стабильную, надежную, интерактивную и удобную для пользователей экосистему для мгновенного обмена сообщениями, которая не зависит от собственности на услуги и хранилищ данных. Мы приветствуем всех, кто верит в открытые стандарты и свободный обмен информацией, чтобы принять участие в дальнейшем развитии Xabber.\\nСледите за нами в Twitter и Github.",xabber_translators:"Xabber доступен на нескольких языках благодаря многим прекрасным людям со всего мира. Мы создали специальную страницу на нашем сайте, чтобы признать их усилия.\\nВы можете присоединиться к ним и помочь нам улучшить качество перевода, внеся свой вклад в проект Xabber.",account_compression:"Использовать сжатие",account_host:"Хост",account_password:"Пароль",confirm_password:"Подтверждение пароля",account_port:"Порт",account_priority:"Приоритет",account_resource:"Ресурс",account_server_name:"Сервер",account_xmpp_register_warning:"Вы должны зарегистрировать учётную запись XMPP перед тем, как добавить её в Xabber!",account_user_name:"Имя пользователя",settings_account__alert_server_not_specified:"Не указано имя сервера",settings_account__alert_xmpp_id_not_specified:"Не указано имя пользователя",settings_account__alert_passwords_do_not_match:"Пароли не совпадают",settings_account__alert_account_exists:"Этот аккаунт уже существует",account_compression_summary:"Отметьте для включения сжатия данных",account_custom:"Указать хост вручную",account_custom_summary:"Указать хост для подключения вручную вместо использования SRV записи",account_invalid_port:"Порт должен быть числом (значение по умолчанию: 5222)",account_i