terface_language__text_description_full_translation:"%1$s දැනටමත් මෙම උපාංගයේ භාවිතා කරන භාෂාවට සම්පූර්ණයෙන්ම පරිවර්තනය කර ඇත. පරිවර්තන සපයනු ලබන්නේ ප්රජාව විසිනි. පරිවර්තනය අසම්පූර්ණ බව ඔබට හැඟේ නම්, ඔබට අපගේ පරිවර්තන කණ්ඩායමට සම්බන්ධ වී %2$s වඩා හොඳ කිරීමට අපට උදව් කළ හැකිය.",settings__interface_language__text_description_unfull_translation:"%1$s මෙම උපාංගයේ භාවිතා කරන භාෂාවට අර්ධ වශයෙන් පරිවර්තනය කර ඇත. පරිවර්තන සපයනු ලබන්නේ ප්රජාව විසිනි, එයින් අදහස් කරන්නේ ඔබේ මව් භාෂාවට %2$s පරිවර්තනය කිරීමට ඔබට අපට උදව් කළ හැකි බවයි!",settings__interface_language__text_description_full_translation_platform:"අපි Crowdin දේශීයකරණ කළමනාකරණ වේදිකාව භාවිතා කරමු. ඔබ සහභාගී වීමට කැමති නම්, මෙම %s අනුගමනය කර ඔබේ මව් භාෂාවට පරිවර්තකයෙකු ලෙස අයදුම් කරන්න.",settings__interface_language__text_description_no_translation_platform:"අපි Crowdin දේශීයකරණ කළමනාකරණ වේදිකාව භාවිතා කරමු. ඔබ අපගේ පරිවර්තන කණ්ඩායමට සම්බන්ධ වීමට කැමති නම්, මෙම %1$sඅනුගමනය කරන්න, අපට %2$s ඊමේල් කරන්න, අපි ඔබේ මව් භාෂාව ඉලක්කගත භාෂා ලැයිස්තුවට එකතු කරන්නෙමු. එවිට ඔබට ඔබේ මව් භාෂාවට පරිවර්තකයෙකු ලෙස අයදුම් කිරීමට හැකි වනු ඇත.",use_external_locations_title:"තෙවන පාර්ශවීය සිතියම්කරණ සේවාව භාවිතා කරන්න \\nසක්රීය කර ඇත්නම්, OpenStreetMap සහ Nominatim සේවාවන් සිතියම් ස්නිපෙට් ප්රදර්ශනය කිරීමට සහ ලබා දී ඇති ඛණ්ඩාංක සඳහා භූ කේත තොරතුරු ආපසු ලබා දීමට භාවිතා කරනු ඇත.",xabber_account_info:"Xabber සේවා භාවිතා කිරීමට සහ උපාංග සැකසුම් සමමුහුර්ත කිරීමට Xabber ගිණුම අවශ්ය වේ.",social_sign_in:"සමාජ සං sign ාව",email_hint:"ඊ-තැපැල්",forgot_pass:"මුරපදය අමතකද?",sync_success:"සමමුහුර්ත",sync_fail:"සමමුහුර්ත අසාර්ථකයි",quit_success:"සාර්ථක නිවාගන්න",confirm_success:"ඊ-තැපැල් තහවුරු",delete_success:"ඊ-තැපැල් නොබැඳුනු",resend_success:"සත්යාපනය ඊමේල් යවන ලදි",social_auth_fail:"සමාජ සත්යාපනය අසාර්ථක විය",settings_delete_success:"මකාදැමූ සැකසුම්",need_login_to_continue:"ඉදිරියට යාමට ඔබ Xabber ගිණුමට පිවිසිය යුතුය",social_bind_success:"සමාජ ජාලය සාර්ථකව සම්බන්ධ වේ",social_bind_fail:"මෙම ගිණුම දැනටමත් විවිධ Xabber ගිණුම සමඟ සම්බන්ධ වී ඇත",social